import React from 'react'

const stories = [
    {   
        user: 'user1',
        title: 'First title',
        body: 'I am the body of the story hello there first title.'
    },
    {   
        user: 'user2',
        title: 'Second title',
        body: 'I am the second body of the story hello there second title.'
    },
    {   
        user: 'user3',
        title: 'third title',
        body: 'I am the body of the story hello there third title.'
    }
]

export default stories;
